import React from 'react';

const Home: React.FC = () => {
  return (
    <div style={{ height: '100vh', paddingTop: '60px' }}>
      <h1>Home</h1>
      <p>Welcome to my portfolio!</p>
    </div>
  );
}

export default Home;
